import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

let rota = 'Login'

function alterarRota (value) {
    console.log(value)
    rota = value
}


function App() {
    if (rota === 'Login') {
        return (
            <div className="App">
                <Login onCadastrar={event => alterarRota(event)}/>
            </div>
        );
    } else if (rota === 'Cadastro') {
        return (
            <div className="App">
                <Cadastro/>
            </div>
        );
    }
}

export default App;
